import React from "react";
import TaskDialog from "./TaskDialog";
// Import Bootstrap CSS in the entry point file (e.g., index.js or App.js) to avoid repeated imports

function TaskTable() {
  return (
    <div className="container mt-5">
      {/* Row for the title and add button */}
      <div className="row mb-3 align-items-center">
        <div className="col-md-6 col-sm-12 text-md-center text-sm-left">
          <h2>Frameworks</h2>
        </div>
        <div className="col-md-6 col-sm-12 text-md-right text-sm-left">
          <button className="btn btn-primary float-md-right float-sm-none">
            Add
          </button>
        </div>
      </div>

      {/* Table and other content below */}
      <table className="table table-bordered">
        <thead className="thead-dark">
          <tr>
            <th>Title</th>
            <th>Description</th>
            <th>Deadline</th>
            <th>Priority</th>
            <th>Is Complete</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>{/* Table rows go here */}</tbody>
      </table>

      <TaskDialog />
    </div>
  );
}

export default TaskTable;
